(1, 'The Miseducation Of Lauryn Hill''', 'YESHA CALLAHAN', '2015-05-19 23:57:25', 'Each year the Library of Congress selects 25 recordings to add to their archive. \r\nThis year Lauryn Hill’s record-breaking album, The Miseducation of Lauryn Hill, will be included in the 25.	\r\nAccording to the press release, requirements for inclusion into the archive include recordings that are “culturally, historically, or aesthetically significant” and are at least 10 years old. ', );
INSERT INTO `novosti` (`id`, `naslov`, `autor`, `vrijeme`, `tekst`, `slika`) VALUES
(2, 'Eternal E: Eazy E, 20 Years Later', 'JEFF WEISS', '2015-05-19 21:22:52', 'It was 20 years ago this week that Eazy E cruised to that great safehouse in the sky. I’ll never forget first hearing the news that he had AIDS and was dying in Cedars-Sinai. The radio station, 92.3 The Beat, kept public vigil. Dre and Cube and Bone Thugs reportedly filed\r\nin to pay last respects to the legend. The hospital was only about a mile from where I had Little League practice and a group of us debated wandering over before quickly realizing that we weren’t exactly wanted.', ''),
(3, 'One Time 4 For Your Mind', 'NAS', '2015-05-19 21:24:26', 'I wreck shit so much, the microphone''ll need a paint job\r\nMy brain is incarcerated\r\nLive at any jam, I couldn''t count all the parks I raided\r\nI hold a Mac-11, and attack a reverend\r\nI contact 11 L''s and max in heaven.\r\nI wreck shit so much, the microphone''ll need a paint job\r\nMy brain is incarcerated\r\nLive at any jam, I couldn''t count all the parks I raided\r\nI hold a Mac-11, and attack a reverend\r\nI contact 11 L''s and max in heaven.', ''),
(4, 'Frenkie i Sarajevska filharmonija', 'FMJam', '2015-05-19 21:25:14', 'U rasprodanom Narodnom pozorištu u Sarajevu, Frenkie je sinoć \r\nnastupio sa Sarajevskom filharmonijom gdje je kao gost koncerta\r\nizveo pjesmu “Noćna smjena”. Ovo je ujedno bio prvi put da se u BiH \r\nostvari fuzija domaćeg hip hop-a i klasične muzike. “Nevjerovatan osjećaj, ovo je nešto... ', ''),
(5, 'Survival Of The Fittest (ESPN Remix)', 'PATRICK LYONS', '2015-05-19 21:26:54', 'A few days back, we reported that Mobb Deep would be remixing their 1995 cut "Survival Of The Fittest" to serve as the intro to ESPNz''s "NBA Countdown" during the Western Conference Playoffs. Today, it''s arrived.\r\nLargely a vocal rework, the only true "remixing" done here is adding some high-octane keyboards to the mix, with the original''s low-key menacing piano shuffle otherwise staying intact.', '');

